import React from "react";
import "./style.css";

class Counter extends React.Component {
  state = {
    count: 0
  }
}

handleIncrement = () => {
  this.setState({ count: this.StaticRange.count + 1 });
}

function ImageCard(props) {
  return (
    <div className="imgContainer">
      <img alt={props.id} src={props.image} onClick={this.handleIncrement} />
    </div>
  );
}

export default ImageCard;
